import React from 'react'
import Layout from '../Layout/Layout'
import SignInFeatures from '../Features/SignInFeatures'

const Signin = () => {
  return (
    <>
    <Layout title={'SignIn Here.'}>
      <SignInFeatures/>
    </Layout>
    </>
  )
}

export default Signin;
